    e.preventDefault();
    let inp = e.target.task.value;
    this.state.todos
    this.setState()
  }
  render() {
    return (
      <div className="todo">
        <form onSubmit={this.submitHandler}>
          <input type="text" name="task" />
          <button>Add Task</button>
        </form>
        <h1>To Do List:</h1>
        <ul>
          {this.state.todos.map((todo, i) => (
            <ToDoItem name={todo} key={i} />
